import React, { Component } from 'react';
import { PDFExport } from '@progress/kendo-react-pdf';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <PDFExport paperSize={'Letter'} fileName="_____.pdf" title="" subject="" keywords="" ref={(r) => this.resume = r}>
          <div style={{height: 792, width: 612, padding: 'none', backgroundColor: 'white', boxShadow: '5px 5px 5px black', margin: 'auto',
            overflowX: 'hidden', overflowY: 'hidden'}}>This will become a resume, yo!</div>
        </PDFExport>
      </div>
    );
  }
}

export default App;
